import './App.css';
import { Route, Routes } from 'react-router-dom';

import Home from './pages/Home';
import MyPortpolio from './pages/MyPortfolio';

function App() {
  return (
    <Routes>
     <Route path='/' element={<Home/>}/>
     <Route path='/portfolio' element={<MyPortfolio/>}/>
    </Routes>
  );
}

export default App;
